import * as volcenginecc from "@volcengine/pulumi-volcenginecc";

const roleDemo = new volcenginecc.iam.Role("RoleDemo", {
    roleName: "RoleDemo",
    description: "role attach policies",
    maxSessionDuration: 3600,
    trustPolicyDocument: `{
    "Statement": [
        {
            "Effect": "Allow",
            "Action": [
                "sts:AssumeRole"
